Column.Formula:
LET $today := NOW();
LET $day := DAY($today);
LET $month := MONTH($today);

RETURN
//Generate quarterly
OR(
	AND($day = 31, $month = 3),
	AND($day = 30, $month = 6),
	AND($day = 30, $month = 9),
	AND($day = 31, $month = 12)
)

