LET $seriesNames := 
ARRAY(
  "Contracts Starting", 
  "Contracts Expiring"
); 

LET $targetDates := 
ARRAY(
  "Start Date", 
  "Current End Date"
); 

LET $tableData := 
ARRAY_SELECT(
	[Report Data], $(s, series) 

	LET $rowData := 
  	ARRAY_SELECT(
		$series, $(r, set)
		LET $value := ARRAY_LENGTH($set);
		LET $startOfPeriod := ARRAY_INDEX($split, $r); 
		LET $targetDate := ARRAY_INDEX($targetDates, $s);
		LET $endOfPeriod :=
		IF( 
			$period = "day", 		 DATEADD("day", 	1, $startOfPeriod),
			$period = "week", 	 	DATEADD("day", 	7, $startOfPeriod),
			$period = "month",	 DATEADD("month", 	1, $startOfPeriod),
			$period = "quarter", 	 DATEADD("month", 	3, $startOfPeriod),
			$period = "year", 	 	DATEADD("year",	1, $startOfPeriod),
		);

		LET $urlFilter := DB_ENCODEIDENTIFIER($targetDate) & " >= " & N($startOfPeriod) & " AND " & DB_ENCODEIDENTIFIER($targetDate) & " < " & N($endOfPeriod);
		LET $url := "tabularreport/Contract?where=" & URLENCODE($urlFilter); 

		RETURN
		HASH(
			"value", $value, 
			"url", $url
		)
	);

  RETURN 
  ARRAY_CONCAT(
	ARRAY(HASH("value", ARRAY_INDEX($seriesNames, $s))), 
	$rowData
  )
);

LET $table := 
HASH(
	"columns", $tableColumns,
	"rows", $tableData
);

RETURN 
$table

