);

//----Build chart----
RETURN 
HASH(
    "series", $seriesData,
    "panes", 
    ARRAY(
        HASH(
            "title", ARRAY_FIRST($seriesNames),
			"data", $chartData
        )
    )
)

//----These variables must be the same length
LET $seriesNames := 
IF(
  [Department - Value or Count] = "Count",
	ARRAY(
	  "Count"
	),
	ARRAY(
	  "Contract Value",
	  "Approved Variation Value"
	)
); 

LET $target := 
IF(
  [Department - Value or Count] = "Count",
	ARRAY(
	  "RecordID"
	),
	ARRAY(
	  "Initial Contract Value Incl. Tax",
	  "Approved Variation Value"
	)
); 

LET $types := 
ARRAY(
  "bar",
  "bar"
); 

LET $split := 
ARRAY_DISTINCT(
  ARRAY_SELECT(
    [Report Data 4], $(i, item) 
    COALESCE(HASH_GET($item, "Department"), "None")
  )
);

LET $labels := $split; 

LET $seriesData := 
ARRAY_SELECTMANY(
  $seriesNames, $(s, series)
  ARRAY(
	  HASH(
	    "label", $series, 
		"color", ARRAY_INDEX([Theme Colours], $s)
	  )
  )
);

LET $chartData := 
ARRAY_SELECT(
  $seriesNames, $(seriesNumber, series)
  HASH(
	"type", ARRAY_INDEX($types, $seriesNumber),

	"data", 
	ARRAY_SELECT(
	  $split, $(s, type) 
	  (	
		LET $matches := 
		  ARRAY_WHERE(
			[Report Data 4], $(i, item)
			HASH_GET($item, "Department") = IF($type = "None", NULL(), $type) 
		);

		LET $result := 
		ARRAY_SELECT(
		  $matches, $(i, item) 
		  HASH_GET($item, ARRAY_INDEX($target, $seriesNumber))
		);

		RETURN IF([Department - Value or Count] = "Value", SUM($result), COUNT($result))
	  )
	)
  )
);

//----Build chart----
RETURN 
HASH(
    "series", $seriesData,
    "panes", 
    ARRAY(
        HASH(
            "labels", $labels,
			"layers", $chartData
        )
    )
)

LET $tableColumns :=
ARRAY(
  HASH("heading", "Contract Number", 	"width", 340, "format", ""),
  HASH("heading", "Department", 		"width", 340, "format", "C"),
  HASH("heading", "Total Contract Value", 	"width", 340, "format", "C")
);

LET $columns :=
ARRAY_SELECT(
  $tableColumns, $(i, item) 
  HASH_GET($item, "heading")
);

LET $formats :=
ARRAY_SELECT(
  $tableColumns, $(i, item) 
  HASH_GET($item, "format")
);

LET $tableData :=
ARRAY_SELECT(
	[Report Data 4], $(s, set) 
	ARRAY_SELECT(
		$columns, $(c, column) 
	    LET $value := HASH_GET($set, $column);
	    LET $format := ARRAY_INDEX($formats, $c);
	    RETURN 
	    HASH(
		  "value", $value, 
		  "format", $format,
		  "url", EBMS_GET_EFORMRECORD_URL("Contract", HASH_GET($set, "RecordID"))
		)  
	)
);

RETURN 
HASH(
  "columns", $tableColumns, 
  "rows", $tableData
)

